import { useContext } from "react";
import UserInfo from "../components/UserInfo";
import AuthContext from "../context/AuthContext";

const Home = () => {
  const { user } = useContext(AuthContext);
  return (
    <div>
      <center>
      {user && <UserInfo user={user} />}
      <h2>Estas en la Pagina Home!</h2>
      </center>
    </div>
  );
};

export default Home;
